//  import PieChart from './components/Piechart';
import Bar from './components/bar';
// import Footer from './components/Footer';
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Example id="1"/>

      <div className='PieChart'><Pie/></div>
      <div><Bar/></div>
     </div>






  );
}

export default App;
